description:
God invented music. At the end of the day, what music really matters? Join our study in REVELATION 15 as we see, the last song mentioned in the Bible is also the first song mentioned. Read Exodus 15:1-19 to learn this important song of Moses. Herein, let's be those who worship the Lord in spirit and in truth!

Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
